import './App.css';
import styled from 'styled-components';
import './fonts/stylesheet.css';
import Header from './components/Header';
import BgHeader from "./components/BackgroundHeader";

const Page = styled.div`
  padding-bottom: 0;
`

const App = () => {
  return (
      <Page>
          <Header />
          <BgHeader />
      </Page>
  );
}

export default App;
